import PopupMassege from './PopupMassege';
import noSuccess from '../images/noSuccess.png';

export default function ErrorMassege(props) {
  return (
    <>
      <PopupMassege
        icon={noSuccess}
        massege='`Oops, something went wrong! Please try again.`'
        onClose={props.onClose}
      />
    </>
  );
}
